import React from 'react';
import BookTable from './components/BookTable';
import UserImput from './components/UserInput';
import MainHeader from './components/MainHeader';

function App() {
  return (
    <div className="App">
      <MainHeader />
      <UserImput />
      <BookTable />
    </div>
  );
}

export default App;
